import React from "react";
import State from "./State";
import GasZTRPrice from "./GasZTRPrice";
import DaysMowedPerWeek from "./DaysMowedPerWeek";
import NumberNGBRUnits from "./NumberNGBRUnits";
import MowingHours from "./MowingHours";
import LengthMowingSeason from "./LengthMowingSeason";

const Inputs = ({
  setCustomerInputs,
  setPADDRegion,
  customerInputs,
  whichStep,
  setWhichStep,
}) => {
  return (
    <div
      className={`inputs ${
        whichStep === 8 ? "floating" : "static"
      }`}
    >
      <ul className="inputs" id="inputs">
        <li className={`column ${whichStep === 1 ? "active" : ""}`}>
          <State
            {...{
              customerInputs,
              setCustomerInputs,
              setPADDRegion,
              inStep: false,
              whichStep,
              setWhichStep,
            }}
          />
        </li>
        <li className={`column ${whichStep === 2 ? "active" : ""}`}>
          <GasZTRPrice
            {...{
              customerInputs,
              setCustomerInputs,
              inStep: false,
              whichStep,
              setWhichStep,
            }}
          />
        </li>
        <li className={`column ${whichStep === 3 ? "active" : ""}`}>
          <DaysMowedPerWeek
            {...{
              customerInputs,
              setCustomerInputs,
              inStep: false,
              whichStep,
              setWhichStep,
            }}
          />
        </li>
        <li className={`column ${whichStep === 4 ? "active" : ""}`}>
          <NumberNGBRUnits
            {...{
              customerInputs,
              setCustomerInputs,
              inStep: false,
              whichStep,
              setWhichStep,
            }}
          />
        </li>
        <li className={`column ${whichStep === 5 ? "active" : ""}`}>
          <MowingHours
            {...{
              customerInputs,
              setCustomerInputs,
              inStep: false,
              whichStep,
              setWhichStep,
            }}
          />
        </li>
        <li className={`column ${whichStep === 6 ? "active" : ""}`}>
          <LengthMowingSeason
            {...{
              customerInputs,
              setCustomerInputs,
              inStep: false,
              whichStep,
              setWhichStep,
            }}
          />
        </li>
      </ul>
    </div>
  );
};

export default Inputs;
